%pyspark
html = """
<link rel='stylesheet' href='http://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.3/leaflet.css'/>                        
<div id='map' style="height:100%"></div>
<script src='http://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.3/leaflet.js'></script>                                 
<script>
//hack to increase vertical mapsize
for (i = 0; i < 45; i++) $('#map').append('<br>');
//center map on Atlanta
var map = L.map('map').setView(new L.LatLng(33.7550, -84.3900), 12);
map.addLayer(new L.TileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png'));
$.get('assets/images/atlanta.geojson', function(data){
  debugger;
  L.geoJson(JSON.parse(data)).addTo(map)
});
</script>
"""

print '%html ' + html
